svg.script:
(function(){
  var SPOUSE = {"P_pol22": ["P_g3p04"], "P_g3p04": ["P_pol22"], "P_pol15": ["P_polS04", "P_polS05"], "P_polS04": ["P_pol15"], "P_pol19": ["P_g2p07"], "P_g2p07": ["P_pol19"], "P_pol21": ["P_g2p14"], "P_g2p14": ["P_pol21"], "P_polS06": ["P_pol16"], "P_pol16": ["P_polS06"], "P_polS09": ["P_pol18"], "P_pol18": ["P_polS09", "P_polS08"], "P_polS07": ["P_pol17"], "P_pol17": ["P_polS07"], "P_polS08": ["P_pol18"], "P_pol11": ["P_polS03", "P_polS02"], "P_polS03": ["P_pol11"], "P_polS05": ["P_pol15"], "P_polS02": ["P_pol11"], "P_g2p10": ["P_pol20"], "P_pol20": ["P_g2p10"], "P_ped01": ["P_pol14"], "P_pol14": ["P_ped01"]};
  var FAMILY = {"M_g3F2": ["P_pol22", "P_g3p04", "P_g3p05", "P_g3p06", "P_g3p07", "P_g3p08"], "M_polF4": ["P_pol15", "P_polS04", "P_pol19"], "M_g2F3": ["P_pol19", "P_g2p07", "P_g2p08", "P_g2p09"], "M_g2F5": ["P_pol21", "P_g2p14", "P_g2p15", "P_g2p16"], "M_polF6": ["P_polS06", "P_pol16", "P_pol22"], "M_polF9": ["P_polS09", "P_pol18", "P_pol25"], "M_polF7": ["P_polS07", "P_pol17", "P_pol23", "P_pol24"], "M_polF8": ["P_polS08", "P_pol18"], "M_polF3": ["P_pol11", "P_polS03", "P_pol15", "P_pol16", "P_pol17", "P_pol18"], "M_polF5": ["P_pol15", "P_polS05", "P_pol20", "P_pol21"], "M_polF2": ["P_pol11", "P_polS02", "P_pol14"], "M_g2F4": ["P_g2p10", "P_pol20", "P_g2p11", "P_g2p12", "P_g2p13"], "M_pedF1": ["P_ped01", "P_pol14", "P_ped02"]};
  function clearHl(){ document.querySelectorAll('.blink').forEach(function(n){ n.classList.remove('blink'); n.classList.remove('highlight'); }); }
  function hl(id){ var el=document.getElementById(id); if(el){ el.classList.add('highlight'); el.classList.add('blink'); } }
  document.addEventListener('click', function(evt){
    var target = evt.target;
    var g = target.closest && target.closest('g[id^="P_"], g[id^="M_"]');
    if (!g) { while (target) { if (target.id && /^([PM]_)/.test(target.id) && target.tagName && target.tagName.toLowerCase() === 'g') { g = target; break; } target = target.parentNode; } }
    if (!g) return;
    var id = g.id; clearHl();
    if (/^P_/.test(id)) { (SPOUSE[id] || []).forEach(hl); }
    else if (/^M_/.test(id)) { hl(id); (FAMILY[id] || []).forEach(hl); }
  }, false);
})();
